class Solution {
    public int findMaximizedCapital(int k, int w, int[] profits, int[] capital) {
        PriorityQueue<int[]> availableProjects = new PriorityQueue<>((a, b) -> a[0] - b[0]);
        PriorityQueue<int[]> potentialProjects = new PriorityQueue<>((a, b) -> b[1] - a[1]);

        int n = profits.length;
        int currentCapital = w;

        for (int i = 0; i < n; i++) {
            availableProjects.offer(new int[]{capital[i], profits[i]});
        }

        for (int i = 0; i < k; i++) {
            while (!availableProjects.isEmpty() && availableProjects.peek()[0] <= currentCapital) {
                potentialProjects.offer(availableProjects.poll());
            }

            if (potentialProjects.isEmpty()) {
                break;
            }

            currentCapital += potentialProjects.poll()[1];
        }

        return currentCapital;
    }
}

public int candy(int[] ratings) {
    int n = ratings.length;
    int[] candies = new int[n];
    Arrays.fill(candies, 1);

    for (int i = 1; i < n; i++) {
        if (ratings[i] > ratings[i - 1]) {
            candies[i] = candies[i - 1] + 1;
        }
    }

    for (int i = n - 2; i >= 0; i--) {
        if (ratings[i] > ratings[i + 1]) {
            candies[i] = Math.max(candies[i], candies[i + 1] + 1);
        }
    }

    int sum = 0;
    for (int candy : candies) {
        sum += candy;
    }

    return sum;
}

