public class Solution {
    public boolean sumGame(String num) {
        int n = num.length();
        int aliceSum = 0, bobSum = 0, aliceQ = 0, bobQ = 0;

        for (int i = 0; i < n / 2; i++) {
            if (num.charAt(i) == '?') {
                aliceQ++;
            } else {
                aliceSum += num.charAt(i) - '0';
            }
        }

        for (int i = n / 2; i < n; i++) {
            if (num.charAt(i) == '?') {
                bobQ++;
            } else {
                bobSum += num.charAt(i) - '0';
            }
        }

        if ((aliceQ + bobQ) % 2 == 1) {
            return true;
        }

        int diff = aliceSum - bobSum;
        int qDiff = (aliceQ - bobQ) / 2;

        return diff * 9 != qDiff * 10;
    }
}

public int minimumTotal(List<List<Integer>> triangle) {
    int n = triangle.size();
    int[] dp = new int[n + 1];

    for (int level = n - 1; level >= 0; level--) {
        List<Integer> currentRow = triangle.get(level);
        for (int i = 0; i < currentRow.size(); i++) {
            dp[i] = currentRow.get(i) + Math.min(dp[i], dp[i + 1]);
        }
    }

    return dp[0];
}

public int racecar(int target) {
    Queue<int[]> queue = new LinkedList<>();
    queue.offer(new int[] {0, 1});
    Set<String> visited = new HashSet<>();
    visited.add("0_1");
    int steps = 0;

    while (!queue.isEmpty()) {
        int size = queue.size();

        for (int i = 0; i < size; i++) {
            int[] curr = queue.poll();
            int pos = curr[0];
            int speed = curr[1];

            if (pos == target) {
                return steps;
            }

            int nextPos = pos + speed;
            int nextSpeed = speed * 2;
            String key = nextPos + "_" + nextSpeed;

            if (!visited.contains(key) && Math.abs(nextPos) < target * 2) {
                queue.offer(new int[] {nextPos, nextSpeed});
                visited.add(key);
            }

            int reverseSpeed = speed > 0 ? -1 : 1;
            nextPos = pos;
            nextSpeed = reverseSpeed;
            key = nextPos + "_" + nextSpeed;

            if (!visited.contains(key) && Math.abs(nextPos) < target * 2) {
                queue.offer(new int[] {nextPos, nextSpeed});
                visited.add(key);
            }
        }

        steps++;
    }

    return -1;
}

public boolean hasPathSum(TreeNode root, int targetSum) {
    if (root == null) {
        return false;
    }
    if (root.left == null && root.right == null && targetSum - root.val == 0) {
        return true;
    }
    return hasPathSum(root.left, targetSum - root.val) || hasPathSum(root.right, targetSum - root.val);
}

