class MinStack {
    private Stack<Integer> stack;
    private Stack<Integer> minStack;

    /** initialize your data structure here. */
    public MinStack() {
        stack = new Stack<>();
        minStack = new Stack<>();
    }

    public void push(int val) {
        stack.push(val);
        if (minStack.isEmpty() || val <= minStack.peek()) {
            minStack.push(val);
        }
    }

    public void pop() {
        if (stack.peek().equals(minStack.peek())) {
            minStack.pop();
        }
        stack.pop();
    }

    public int top() {
        return stack.peek();
    }

    public int getMin() {
        return minStack.peek();
    }
}

public class LRUCache {

    private Map<Integer, Integer> cache;
    private Deque<Integer> deque;
    private int capacity;

    public LRUCache(int capacity) {
        this.cache = new HashMap<>();
        this.deque = new LinkedList<>();
        this.capacity = capacity;
    }

    public int get(int key) {
        if(cache.containsKey(key)) {
            deque.remove(key);
            deque.offer(key);
            return cache.get(key);
        }
        return -1;
    }

    public void put(int key, int value) {
        if(cache.containsKey(key)) {
            deque.remove(key);
        } else if(cache.size() >= capacity) {
            int leastRecentlyUsed = deque.poll();
            cache.remove(leastRecentlyUsed);
        }
        cache.put(key, value);
        deque.offer(key);
    }
}

public class Solution {
    public boolean canIWin(int maxChoosableInteger, int desiredTotal) {
        if (desiredTotal <= 0) {
            return true;
        }
        if (maxChoosableInteger * (maxChoosableInteger + 1) / 2 < desiredTotal) {
            return false;
        }
        return canWin(0, desiredTotal, new HashMap<>(), new boolean[maxChoosableInteger + 1]);
    }

    private boolean canWin(int state, int total, Map<Integer, Boolean> map, boolean[] used) {
        if (total <= 0) {
            return false;
        }
        if (map.containsKey(state)) {
            return map.get(state);
        }
        for (int i = 1; i < used.length; i++) {
            if (!used[i]) {
                used[i] = true;
                if (!canWin(state | (1 << i), total - i, map, used)) {
                    map.put(state, true);
                    used[i] = false;
                    return true;
                }
                used[i] = false;
            }
        }
        map.put(state, false);
        return false;
    }
}

