public int maxPoints(int[][] grid) {
    int n = grid[0].length;
    for (int i = 1; i < n; i++) {
        grid[0][i] += grid[0][i - 1];
    }
    for (int i = 1; i < 2; i++) {
        grid[i][0] += grid[i - 1][0];
        for (int j = 1; j < n; j++) {
            grid[i][j] += Math.max(grid[i - 1][j], grid[i][j - 1]);
        }
    }
    return grid[1][n - 1];
