public boolean canCross(int[] stones) {
    if (stones == null || stones.length == 0 || stones[1] != 1) {
        return false;
    }

    Set<Integer> stonePositions = new HashSet<>();
    for (int stone : stones) {
        stonePositions.add(stone);
    }

    Map<Integer, Set<Integer>> dp = new HashMap<>();
    dp.put(0, new HashSet<>());
    dp.get(0).add(1);

    for (int i = 1; i < stones.length; i++) {
        dp.put(stones[i], new HashSet<>());
    }

    for (int i = 0; i < stones.length - 1; i++) {
        int stone = stones[i];
        for (int step : dp.get(stone)) {
            for (int nextStep = step - 1; nextStep <= step + 1; nextStep++) {
                if (nextStep > 0 && stonePositions.contains(stone + nextStep)) {
                    if (stone + nextStep == stones[stones.length - 1]) {
                        return true;
                    }
                    dp.get(stone + nextStep).add(nextStep);
                }
            }
        }
    }

    return false;
}

public int findNthDigit(int n) {
    int len = 1;
    long count = 9;
    int start = 1;

    while (n > len * count) {
        n -= len * count;
        len++;
        count *= 10;
        start *= 10;
    }

    start += (n - 1) / len;
    String s = Integer.toString(start);
    return Character.getNumericValue(s.charAt((n - 1) % len));
}

