class Solution {
    public int numBusesToDestination(int[][] routes, int source, int target) {
        if (source == target) {
            return 0;
        }

        Map<Integer, List<Integer>> map = new HashMap<>();
        Set<Integer> visited = new HashSet<>();
        Set<Integer> targets = new HashSet<>();
        Queue<Integer> queue = new LinkedList<>();

        for (int i = 0; i < routes.length; i++) {
            for (int j : routes[i]) {
                List<Integer> buses = map.getOrDefault(j, new ArrayList<>());
                buses.add(i);
                map.put(j, buses);
            }
        }

        int buses = 0;
        queue.offer(source);
        visited.add(source);
        targets.add(target);

        while (!queue.isEmpty()) {
            int size = queue.size();
            buses++;
            for (int i = 0; i < size; i++) {
                int currStop = queue.poll();
                List<Integer> busesAtStop = map.get(currStop);
                for (int bus : busesAtStop) {
                    if (visited.contains(bus)) {
                        continue;
                    }
                    visited.add(bus);
                    for (int stop : routes[bus]) {
                        if (targets.contains(stop)) {
                            return buses;
                        }
                        queue.offer(stop);
                    }
                }
            }
        }

        return -1;
    }
}

public boolean aliceWinsGame(int[] piles) {
    int n = piles.length;
    int[][] dp = new int[n][n];

    for (int i = 0; i < n; i++) {
        dp[i][i] = piles[i];
    }

    for (int len = 2; len <= n; len++) {
        for (int i = 0; i <= n - len; i++) {
            int j = i + len - 1;
            dp[i][j] = Math.max(piles[i] - dp[i + 1][j], piles[j] - dp[i][j - 1]);
        }
    }

    return dp[0][n - 1] > 0;
}

