class Solution {
    public int[][] floodFill(int[][] image, int sr, int sc, int color) {
        int originalColor = image[sr][sc];
        if (originalColor != color) {
            floodFillHelper(image, sr, sc, originalColor, color);
        }
        return image;
    }

    private void floodFillHelper(int[][] image, int sr, int sc, int originalColor, int color) {
        if (sr < 0 || sr >= image.length || sc < 0 || sc >= image[0].length || image[sr][sc] != originalColor) {
            return;
        }
        image[sr][sc] = color;
        floodFillHelper(image, sr + 1, sc, originalColor, color);
        floodFillHelper(image, sr - 1, sc, originalColor, color);
        floodFillHelper(image, sr, sc + 1, originalColor, color);
        floodFillHelper(image, sr, sc - 1, originalColor, color);
    }
}
