    public int maxJumps(int[] arr, int d) {
        int n = arr.length;
        int[] dp = new int[n];
        int max = 0;

        for (int i = 0; i < n; i++) {
            max = Math.max(max, dfs(arr, d, dp, i));
        }

        return max;
    }

    private int dfs(int[] arr, int d, int[] dp, int i) {
        if (dp[i] != 0) {
            return dp[i];
        }

        int max = 1;
        for (int j = i + 1; j <= Math.min(i + d, arr.length - 1) && arr[i] > arr[j]; j++) {
            max = Math.max(max, 1 + dfs(arr, d, dp, j));
        }

        for (int j = i - 1; j >= Math.max(i - d, 0) && arr[i] > arr[j]; j--) {
            max = Math.max(max, 1 + dfs(arr, d, dp, j));
        }

        dp[i] = max;
        return max;
    }
