public int removeBoxes(int[] boxes) {
    int n = boxes.length;
    int[][][] dp = new int[n][n][n];

    return calculatePoints(boxes, dp, 0, n - 1, 0);
}

private int calculatePoints(int[] boxes, int[][][] dp, int i, int j, int k) {
    if (i > j) {
        return 0;
    }

    if (dp[i][j][k] != 0) {
        return dp[i][j][k];
    }

    while (i < j && boxes[j] == boxes[j - 1]) {
        j--;
        k++;
    }

    dp[i][j][k] = calculatePoints(boxes, dp, i, j - 1, 0) + (k + 1) * (k + 1);

    for (int p = i; p < j; p++) {
        if (boxes[p] == boxes[j]) {
            dp[i][j][k] = Math.max(dp[i][j][k], calculatePoints(boxes, dp, i, p, k + 1) + calculatePoints(boxes, dp, p + 1, j - 1, 0));
        }
    }

    return dp[i][j][k];
}

public int maxScore(int[] nums, int k) {
    int n = nums.length;
    int[] dp = new int[n];
    dp[0] = nums[0];

    for (int i = 1; i < n; i++) {
        int max = 0;
        for (int j = Math.max(0, i - k); j < i; j++) {
            max = Math.max(max, dp[j]);
        }
        dp[i] = max + nums[i];
    }

    return dp[n - 1];
}

class Solution {
    public int pathSum(TreeNode root, int targetSum) {
        if (root == null) {
            return 0;
        }

        return dfs(root, targetSum) + pathSum(root.left, targetSum) + pathSum(root.right, targetSum);
    }

    private int dfs(TreeNode node, int target) {
        if (node == null) {
            return 0;
        }

        int count = 0;
        if (node.val == target) {
            count++;
        }

        count += dfs(node.left, target - node.val);
        count += dfs(node.right, target - node.val);

        return count;
    }
}

