public int cherryPickup(int[][] grid) {
    int n = grid.length;
    int[][][] dp = new int[n][n][n];

    for (int r1 = 0; r1 < n; r1++) {
        for (int c1 = 0; c1 < n; c1++) {
            for (int r2 = 0; r2 < n; r2++) {
                int c2 = r1 + c1 - r2;
                if (c2 < 0 || c2 >= n || grid[r1][c1] == -1 || grid[r2][c2] == -1) {
                    dp[r1][c1][r2] = Integer.MIN_VALUE;
                } else if (r1 == 0 && c1 == 0) {
                    dp[r1][c1][r2] = grid[r1][c1];
                } else {
                    int cherries = grid[r1][c1];
                    if (r1 != r2) cherries += grid[r2][c2];
                    int max = Math.max(Math.max(dp[r1 - 1][c1][r2], dp[r1][c1 - 1][r2]), Math.max(dp[r1 - 1][c1][r2 - 1], dp[r1][c1 - 1][r2 - 1]));
                    if (max < 0) {
                        dp[r1][c1][r2] = -1;
                    } else {
                        dp[r1][c1][r2] = cherries + max;
                    }
                }
            }
        }
    }

    return Math.max(0, dp[n - 1][n - 1][n - 1]);
}

