private List<String> wordBreakUtil(String s, Set<String> dict, int start, Map<Integer, List<String>> dp) {
    if (dp.containsKey(start)) {
        return dp.get(start);
    }
    List<String> result = new ArrayList<>();
    if (start == s.length()) {
        result.add("");
    }
    for (int end = start + 1; end <= s.length(); end++) {
        String word = s.substring(start, end);
        if (dict.contains(word)) {
            List<String> sublist = wordBreakUtil(s, dict, end, dp);
            for (String sub : sublist) {
                result.add(word + (sub.isEmpty() ? "" : " ") + sub);
            }
        }
    }
    dp.put(start, result);
    return result;
}

public int bagOfTokensScore(int[] tokens, int power) {
    Arrays.sort(tokens);
    int score = 0;
    int maxScore = 0;
    int left = 0;
    int right = tokens.length - 1;

    while (left <= right) {
        if (power >= tokens[left]) {
            power -= tokens[left];
            left++;
            score++;
            maxScore = Math.max(maxScore, score);
        } else if (score > 0) {
            power += tokens[right];
            right--;
            score--;
        } else {
            break;
        }
    }

    return maxScore;
}

public boolean buddyStrings(String s, String goal) {
