    }

    if(s.equals(goal)) {
        Set<Character> set = new HashSet<>();
        for(char c : s.toCharArray()) {
            if(!set.add(c)) {
                return true;
            }
        }
        return false;
    }

    List<Integer> diff = new ArrayList<>();
    for(int i = 0; i < s.length(); i++) {
        if(s.charAt(i) != goal.charAt(i)) {
            diff.add(i);
        }
    }

    return diff.size() == 2 && s.charAt(diff.get(0)) == goal.charAt(diff.get(1)) && s.charAt(diff.get(1)) == goal.charAt(diff.get(0));
}

int largestOverlap(int[][] img1, int[][] img2) {
    int n = img1.length;
    int maxOverlap = 0;

    for (int rowOffset = -n + 1; rowOffset < n; rowOffset++) {
        for (int colOffset = -n + 1; colOffset < n; colOffset++) {
            int currentOverlap = 0;
            for (int i = 0; i < n; i++) {
                for (int j = 0; j < n; j++) {
                    if ((i + rowOffset >= 0 && i + rowOffset < n) && (j + colOffset >= 0 && j + colOffset < n)) {
                        currentOverlap += img1[i + rowOffset][j + colOffset] & img2[i][j];
                    }
                }
            }
            maxOverlap = Math.max(maxOverlap, currentOverlap);
        }
    }

    return maxOverlap;
}

