public int oddEvenJumps(int[] arr) {
    int n = arr.length;
    boolean[] higher = new boolean[n];
    boolean[] lower = new boolean[n];
    higher[n - 1] = true;
    lower[n - 1] = true;
    TreeMap<Integer, Integer> map = new TreeMap<>();
    map.put(arr[n - 1], n - 1);
    int result = 1;

    for (int i = n - 2; i >= 0; i--) {
        Integer hi = map.ceilingKey(arr[i]);
        Integer lo = map.floorKey(arr[i]);

        if (hi != null) {
            higher[i] = lower[map.get(hi)];
        }
        if (lo != null) {
            lower[i] = higher[map.get(lo)];
        }

        if (higher[i]) {
            result++;
        }

        map.put(arr[i], i);
    }

    return result;
}

