        int n = grid[0].length;

        k = k % (m * n);

        while (k > 0) {
            int temp = grid[m - 1][n - 1];
            for (int i = m - 1; i >= 0; i--) {
                for (int j = n - 1; j > 0; j--) {
                    grid[i][j] = grid[i][j - 1];
