public double soupServings(int N) {
    if (N >= 5000) {
        return 1.0;
    }
    int n = (N + 24) / 25;
    double[][] dp = new double[n + 1][n + 1];
    dp[0][0] = 0.5;
    for (int i = 1; i <= n; ++i) {
        dp[0][i] = 1;
        dp[i][0] = 0;
    }
    for (int i = 1; i <= n; ++i) {
        int a1 = Math.max(0, i - 4), b1 = i;
        int a2 = Math.max(0, i - 3), b2 = i - 1;
        int a3 = Math.max(0, i - 2), b3 = i - 2;
        int a4 = Math.max(0, i - 1), b4 = i - 3;
        dp[i][0] = 0.25 * (dp[a1][b1] + dp[a2][b2] + dp[a3][b3] + dp[a4][b4]);
        dp[i][i] = 0.25 * dp[Math.max(0, i - 4)][i - 4];
    }
    double ans = 0;
    for (int i = 0; i < n; ++i) {
        ans += dp[i][n - i];
    }
    return ans;
}

