        for (int i = 3; i < n; i++) {
            if (distance[i] >= distance[i-2] && distance[i-1] <= distance[i-3]) return true;
            if (i >= 4 && distance[i-1] == distance[i-3] && distance[i] + distance[i-4] >= distance[i-2]) return true;
            if (i >= 5 && distance[i-2] >= distance[i-4] && distance[i] + distance[i-4] >= distance[i-2] && distance[i-1] <= distance[i-3] && distance[i-1] + distance[i-5] >= distance[i-3]) return true;
        }

        return false;
    }
}

public String pushDominoes(String dominoes) {
    char[] dom = dominoes.toCharArray();
    int n = dom.length;
    int[] forces = new int[n];

    int force = 0;
    for (int i = 0; i < n; i++) {
        if (dom[i] == 'R') force = n;
        else if (dom[i] == 'L') force = 0;
        else force = Math.max(force - 1, 0);
        forces[i] += force;
    }

    force = 0;
    for (int i = n - 1; i >= 0; i--) {
        if (dom[i] == 'L') force = n;
        else if (dom[i] == 'R') force = 0;
        else force = Math.max(force - 1, 0);
        forces[i] -= force;
    }

    StringBuilder sb = new StringBuilder();
    for (int f : forces) {
        if (f == 0) sb.append('.');
        else if (f > 0) sb.append('R');
        else sb.append('L');
    }

    return sb.toString();
}

