public class Solution {
    public int catMouseGame(int[][] graph) {
        int n = graph.length;
        int[][][] dp = new int[n][n][2];

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                Arrays.fill(dp[i][j], -1);
            }
        }

        return helper(1, 2, 1, graph, dp);
    }

    private int helper(int mouse, int cat, int turn, int[][] graph, int[][][] dp) {
        if (dp[mouse][cat][turn] != -1) {
            return dp[mouse][cat][turn];
        }

        dp[mouse][cat][turn] = 0;
        int result = 0;

        if (turn == 1) {
            boolean mouseWin = true;
            for (int next : graph[mouse]) {
                if (next == 0) {
                    continue;
                }
                int nextResult = helper(next, cat, 2, graph, dp);
                if (nextResult == 1) {
                    dp[mouse][cat][turn] = 1;
                    return 1;
                } else if (nextResult == 0) {
                    mouseWin = false;
                }
            }
            if (mouseWin) {
                dp[mouse][cat][turn] = 2;
                return 2;
            }
        } else {
            boolean catWin = true;
            for (int next : graph[cat]) {
                if (next == 0) {
                    continue;
                }
                if (next == mouse) {
                    dp[mouse][cat][turn] = 2;
                    return 2;
                }
                int nextResult = helper(mouse, next, 1, graph, dp);
                if (nextResult == 2) {
                    dp[mouse][cat][turn] = 2;
                    return 2;
                } else if (nextResult == 0) {
                    catWin = false;
                }
            }
            if (catWin) {
                dp[mouse][cat][turn] = 1;
                return 1;
            }
        }

        return dp[mouse][cat][turn];
    }
}

