public class KnightDialer {
    private static final int MOD = 1000000007;
    private static final int[][] moves = {
        {-2, -1}, {-2, 1}, {-1, -2}, {-1, 2},
        {1, -2}, {1, 2}, {2, -1}, {2, 1}
    };
    private static final int[][] phonePad = {
        {1, 2, 3},
        {4, 5, 6},
        {7, 8, 9},
        {-1, 0, -1}
    };

    public int knightDialer(int n) {
        if (n == 0) return 0;

        long[][] dp = new long[4][3];
        for (int i = 0; i < 4; i++) {
            for (int j = 0; j < 3; j++) {
                if (phonePad[i][j] != -1) {
                    dp[i][j] = 1;
                }
            }
        }

        for (int step = 1; step < n; step++) {
            long[][] newDp = new long[4][3];
            for (int i = 0; i < 4; i++) {
                for (int j = 0; j < 3; j++) {
                    if (phonePad[i][j] != -1) {
                        for (int[] move : moves) {
                            int newRow = i + move[0];
                            int newCol = j + move[1];
                            if (newRow >= 0 && newRow < 4 && newCol >= 0 && newCol < 3 && phonePad[newRow][newCol] != -1) {
                                newDp[i][j] = (newDp[i][j] + dp[newRow][newCol]) % MOD;
                            }
                        }
                    }
                }
            }
            dp = newDp;
        }

        long result = 0;
        for (int i = 0; i < 4; i++) {
            for (int j = 0; j < 3; j++) {
                result = (result + dp[i][j]) % MOD;
            }
        }
        return (int) result;
    }
}
