public class Solution {
    public int stoneGameII(int[] piles) {
        int n = piles.length;
        int[] prefixSum = new int[n];
        prefixSum[n - 1] = piles[n - 1];
        for (int i = n - 2; i >= 0; i--) {
            prefixSum[i] = prefixSum[i + 1] + piles[i];
        }
        int[][] dp = new int[n][n + 1];
        return helper(piles, 0, 1, dp, prefixSum);
    }

    private int helper(int[] piles, int i, int M, int[][] dp, int[] prefixSum) {
        if (i == piles.length) {
            return 0;
        }
        if (dp[i][M] != 0) {
            return dp[i][M];
        }
        int maxStones = 0;
        int maxTaken = Math.min(2 * M, piles.length - i);
        for (int x = 1; x <= maxTaken; x++) {
            int takenStones = prefixSum[i] - helper(piles, i + x, Math.max(M, x), dp, prefixSum);
            maxStones = Math.max(maxStones, takenStones);
        }
        dp[i][M] = maxStones;
        return maxStones;
    }
}

