        int[] dp = new int[n + 1];

        for (int i = n - 1; i >= 0; i--) {
            int maxScore = Integer.MIN_VALUE;
            int currSum = 0;
            for (int j = 0; j < 3 && i + j < n; j++) {
                currSum += stoneValue[i + j];
                maxScore = Math.max(maxScore, currSum - dp[i + j + 1]);
