class Solution {
    public int stoneGameVII(int[] stones) {
        int n = stones.length;
        int[] prefixSum = new int[n + 1];

        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + stones[i];
        }

        int[][] dp = new int[n][n];

        for (int i = n - 2; i >= 0; i--) {
            for (int j = i + 1; j < n; j++) {
                dp[i][j] = Math.max(prefixSum[j + 1] - prefixSum[i + 1] - dp[i + 1][j], 
                                    prefixSum[j] - prefixSum[i] - dp[i][j - 1]);
            }
        }

        return dp[0][n - 1];
    }
}

