class Solution {
    public List<List<String>> findLadders(String beginWord, String endWord, List<String> wordList) {
        List<List<String>> result = new ArrayList<>();
        Set<String> dict = new HashSet<>(wordList);
        if (!dict.contains(endWord)) {
            return result;
        }

        Queue<List<String>> queue = new LinkedList<>();
        queue.add(Arrays.asList(beginWord));

        Set<String> visited = new HashSet<>();
        visited.add(beginWord);

        boolean found = false;

        while (!queue.isEmpty() && !found) {
            int size = queue.size();
            Set<String> currentLevelVisited = new HashSet<>();

            for (int i = 0; i < size; i++) {
                List<String> path = queue.poll();
                String currentWord = path.get(path.size() - 1);

                char[] currentArr = currentWord.toCharArray();
                for (int j = 0; j < currentArr.length; j++) {
                    char originalChar = currentArr[j];
                    for (char c = 'a'; c <= 'z'; c++) {
                        currentArr[j] = c;
                        String newWord = new String(currentArr);
                        if (dict.contains(newWord)) {
                            if (newWord.equals(endWord)) {
                                found = true;
                                path.add(newWord);
                                result.add(new ArrayList<>(path));
                                path.remove(path.size() - 1);
                            }
                            if (!visited.contains(newWord)) {
                                path.add(newWord);
                                queue.add(new ArrayList<>(path));
                                path.remove(path.size() - 1);
                                currentLevelVisited.add(newWord);
                            }
                        }
                    }
                    currentArr[j] = originalChar;
                }
            }

            visited.addAll(currentLevelVisited);
        }

        return result;
    }
}

public int numDecodings(String s) {
    int mod = 1000000007;
    long[] dp = new long[s.length() + 1];
    dp[0] = 1;
    dp[1] = s.charAt(0) == '0' ? 0 : s.charAt(0) == '*' ? 9 : 1;

    for (int i = 2; i <= s.length(); i++) {
        char first = s.charAt(i - 2);
        char second = s.charAt(i - 1);

        if (second == '*') {
            dp[i] += 9 * dp[i - 1];
        } else if (second > '0') {
            dp[i] += dp[i - 1];
        }

        if (first == '1' || first == '*') {
            if (second == '*') {
                dp[i] += 9 * dp[i - 2];
            } else {
                dp[i] += dp[i - 2];
            }
        }

        if (first == '2' || first == '*') {
            if (second == '*') {
                dp[i] += 6 * dp[i - 2];
            } else if (second <= '6') {
                dp[i] += dp[i - 2];
            }
        }

        dp[i] %= mod;
    }

    return (int) dp[s.length()];
}

