public boolean canVisitAllRooms(List<List<Integer>> rooms) {
    Set<Integer> visited = new HashSet<>();
    visited.add(0);
    Stack<Integer> stack = new Stack<>();
    stack.push(0);

    while (!stack.isEmpty()) {
        int currentRoom = stack.pop();
        for (int key : rooms.get(currentRoom)) {
            if (!visited.contains(key)) {
