public class Solution {
    public int slidingPuzzle(int[][] board) {
        int[][] target = {{1, 2, 3}, {4, 5, 0}};
        String targetStr = Arrays.deepToString(target);
        String startStr = Arrays.deepToString(board);

        if (targetStr.equals(startStr)) {
            return 0;
        }

        Set<String> visited = new HashSet<>();
        visited.add(startStr);

        int[][] dirs = {{1, 0}, {-1, 0}, {0, 1}, {0, -1}};

        Queue<int[][]> queue = new LinkedList<>();
        queue.offer(board);

        int moves = 0;

        while (!queue.isEmpty()) {
            int size = queue.size();

            for (int i = 0; i < size; i++) {
                int[][] current = queue.poll();

                int zeroRow = 0;
                int zeroCol = 0;

                outer:
                for (int row = 0; row < 2; row++) {
                    for (int col = 0; col < 3; col++) {
                        if (current[row][col] == 0) {
                            zeroRow = row;
                            zeroCol = col;
                            break outer;
                        }
                    }
                }

                for (int[] dir : dirs) {
                    int newRow = zeroRow + dir[0];
                    int newCol = zeroCol + dir[1];

                    if (newRow >= 0 && newRow < 2 && newCol >= 0 && newCol < 3) {
                        int[][] newBoard = new int[2][3];
                        for (int j = 0; j < 2; j++) {
                            newBoard[j] = current[j].clone();
                        }

                        newBoard[zeroRow][zeroCol] = newBoard[newRow][newCol];
                        newBoard[newRow][newCol] = 0;

                        String newBoardStr = Arrays.deepToString(newBoard);

                        if (targetStr.equals(newBoardStr)) {
                            return moves + 1;
                        }

                        if (!visited.contains(newBoardStr)) {
                            visited.add(newBoardStr);
                            queue.offer(newBoard);
                        }
                    }
                }
            }

            moves++;
        }

        return -1;
    }
}

