public int maxCoins(int[] nums) {
    int n = nums.length;
    int[] balloons = new int[n + 2];
    balloons[0] = 1;
    balloons[n + 1] = 1;
    for (int i = 1; i <= n; i++) {
        balloons[i] = nums[i - 1];
    }

    int[][] dp = new int[n + 2][n + 2];
    for (int len = 1; len <= n; len++) {
        for (int i = 1; i <= n - len + 1; i++) {
            int j = i + len - 1;
            for (int k = i; k <= j; k++) {
                dp[i][j] = Math.max(dp[i][j], dp[i][k - 1] + balloons[i - 1] * balloons[k] * balloons[j + 1] + dp[k + 1][j]);
            }
        }
    }

    return dp[1][n];
}

