    private void dfs(String email, Set<String> visited, Map<String, List<String>> graph, List<String> emails) {
        visited.add(email);
        emails.add(email);
        for (String nextEmail : graph.get(email)) {
            if (!visited.contains(nextEmail)) {
                dfs(nextEmail, visited, graph, emails);
            }
        }
    }
