import java.util.ArrayList;
import java.util.HashSet;
import java.util.List;
import java.util.Set;

public class WordSearchII {
    private Set<String> result = new HashSet<>();
    private TrieNode root;
    private char[][] board;
    private boolean[][] visited;
    private int m, n;

    class TrieNode {
        TrieNode[] children = new TrieNode[26];
        boolean isEndOfWord = false;
    }

    public List<String> findWords(char[][] board, String[] words) {
        this.board = board;
        this.m = board.length;
        this.n = board[0].length;
        root = buildTrie(words);
        visited = new boolean[m][n];

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                backtrack(i, j, root, "");
            }
        }
        return new ArrayList<>(result);
    }

    private void backtrack(int i, int j, TrieNode node, String word) {
        if (node.isEndOfWord) {
            result.add(word);
            node.isEndOfWord = false; // avoid duplicates
        }
        if (i < 0 || j < 0 || i >= m || j >= n || visited[i][j] || node.children[board[i][j] - 'a'] == null) {
            return;
        }

        visited[i][j] = true;
        node = node.children[board[i][j] - 'a'];
        word += board[i][j];

        backtrack(i + 1, j, node, word);
        backtrack(i - 1, j, node, word);
        backtrack(i, j + 1, node, word);
        backtrack(i, j - 1, node, word);

        visited[i][j] = false;
    }

    private TrieNode buildTrie(String[] words) {
        TrieNode root = new TrieNode();
        for (String word : words) {
            TrieNode node = root;
            for (char c : word.toCharArray()) {
                if (node.children[c - 'a'] == null) {
                    node.children[c - 'a'] = new TrieNode();
                }
                node = node.children[c - 'a'];
            }
            node.isEndOfWord = true;
        }
        return root;
    }
}
