public int nthUglyNumber(int n, int a, int b, int c) {
    int lo = 1, hi = Integer.MAX_VALUE;
    while (lo < hi) {
        int mid = lo + (hi - lo) / 2;
        if (countUgly(mid, a, b, c) < n) {
            lo = mid + 1;
        } else {
            hi = mid;
        }
    }
