}

private int countUgly(int num, int a, int b, int c) {
    return (int) (num / a + num / b + num / c
            - num / lcm(a, b)
            - num / lcm(b, c)
            - num / lcm(a, c)
            + num / lcm(a, lcm(b, c)));
}

private long lcm(long a, long b) {
    return a * b / gcd(a, b);
}

private long gcd(long a, long b) {
    while (b > 0) {
        long temp = b;
        b = a % b;
        a = temp;
    }
    return a;
}

