public class Solution {
    public List<List<Integer>> outerTrees(int[][] trees) {
        Arrays.sort(trees, (a, b) -> a[0] == b[0] ? a[1] - b[1] : a[0] - b[0]);
        Stack<List<Integer>> hull = new Stack<>();
        for (int[] tree : trees) {
            while (hull.size() >= 2 && orientation(hull.get(hull.size() - 2), hull.get(hull.size() - 1), Arrays.stream(tree).boxed().collect(Collectors.toList())) > 0) {
                hull.pop();
            }
            hull.push(Arrays.stream(tree).boxed().collect(Collectors.toList()));
        }
        hull.pop();
        for (int i = trees.length - 1; i >= 0; i--) {
            while (hull.size() >= 2 && orientation(hull.get(hull.size() - 2), hull.get(hull.size() - 1), Arrays.stream(trees[i]).boxed().collect(Collectors.toList())) > 0) {
                hull.pop();
            }
            hull.push(Arrays.stream(trees[i]).boxed().collect(Collectors.toList()));
        }
        return new ArrayList<>(new HashSet<>(hull));
    }

    private int orientation(List<Integer> p, List<Integer> q, List<Integer> r) {
        return (q.get(1) - p.get(1)) * (r.get(0) - q.get(0)) - (q.get(0) - p.get(0)) * (r.get(1) - q.get(1));
    }
}

