            int left = positions[i][0];
            int sideLength = positions[i][1];
            int right = left + sideLength;
            int start = intervals.size();
            int height = 0;

            for (int j = start - 1; j >= 0; j--) {
                int[] interval = intervals.get(j);
                if (interval[0] >= right) continue;
