public int minCost(int[] houses, int[][] cost, int m, int n, int target) {
    int[][][] dp = new int[m + 1][n + 1][target + 1];

    for (int i = 0; i <= m; i++) {
        for (int j = 0; j <= n; j++) {
            for (int k = 0; k <= target; k++) {
                dp[i][j][k] = Integer.MAX_VALUE;
            }
        }
    }

    if (houses[0] == 0) {
        for (int i = 1; i <= n; i++) {
            dp[1][i][1] = cost[0][i - 1];
        }
    } else {
        dp[1][houses[0]][1] = 0;
    }

    for (int i = 2; i <= m; i++) {
        int prevColor = houses[i - 2];
        int currColor = houses[i - 1];

        for (int j = 1; j <= n; j++) {
            for (int k = 1; k <= target; k++) {
                if (houses[i - 1] != 0 && j != houses[i - 1]) {
                    continue;
                }

                for (int l = 1; l <= n; l++) {
                    int costToPaint = (j == l) ? 0 : cost[i - 1][l - 1];

                    if (prevColor != 0) {
                        dp[i][j][k] = Math.min(dp[i][j][k], dp[i - 1][prevColor][k - (j == prevColor ? 0 : 1)]);
                    } else {
                        dp[i][j][k] = Math.min(dp[i][j][k], dp[i - 1][l][k - (j == l ? 0 : 1)]);
                    }

                    if (dp[i][j][k] != Integer.MAX_VALUE) {
                        dp[i][j][k] += costToPaint;
                    }
                }
            }
        }
    }

    int result = Integer.MAX_VALUE;

    for (int i = 1; i <= n; i++) {
        result = Math.min(result, dp[m][i][target]);
    }

    return (result == Integer.MAX_VALUE) ? -1 : result;
}

