    return shopping(price, special, needs);
}

private int shopping(List<Integer> price, List<List<Integer>> special, List<Integer> needs) {
    int result = dot(needs, price);
    for (List<Integer> s : special) {
        ArrayList<Integer> clone = new ArrayList<>(needs);
        boolean isValid = true;
        for (int j = 0; j < needs.size(); j++) {
            int diff = clone.get(j) - s.get(j);
            if (diff < 0) {
                isValid = false;
                break;
            }
            clone.set(j, diff);
        }
        if (isValid) {
            result = Math.min(result, s.get(needs.size()) + shopping(price, special, clone));
        }
    }
    return result;
}

private int dot(List<Integer> a, List<Integer> b) {
    int sum = 0;
    for (int i = 0; i < a.size(); i++) {
        sum += a.get(i) * b.get(i);
    }
    return sum;
}

