    res.add(1);

    while (res.size() < n) {
        List<Integer> temp = new ArrayList<>();

        for (int num : res) {
            if (num * 2 - 1 <= n) {
                temp.add(num * 2 - 1);
            }
        }

        for (int num : res) {
            if (num * 2 <= n) {
                temp.add(num * 2);
            }
        }

        res = temp;
    }

    return res.stream().mapToInt(i -> i).toArray();
}

class Solution {
    public int maxRotateFunction(int[] nums) {
        int n = nums.length;
        int sum = 0;
        int F = 0;

        for (int i = 0; i < n; i++) {
            sum += nums[i];
            F += i * nums[i];
        }

        int max = F;

        for (int i = 1; i < n; i++) {
            F = F + sum - n * nums[n - i];
            max = Math.max(max, F);
        }

        return max;
    }
}

