public boolean isPrime(int n) {
    if (n < 2) {
        return false;
    }
    int R = (int) Math.sqrt(n);
    for (int d = 2; d <= R; ++d) {
        if (n % d == 0) {
            return false;
        }
    }
    return true;
}

public class Solution {
    public int uniquePathsIII(int[][] grid) {
        int empty = 1, sx = 0, sy = 0;
        for (int i = 0; i < grid.length; i++) {
            for (int j = 0; j < grid[0].length; j++) {
                if (grid[i][j] == 0) {
                    empty++;
                } else if (grid[i][j] == 1) {
                    sx = i;
                    sy = j;
                }
            }
        }
        return dfs(grid, sx, sy, empty);
    }

    private int dfs(int[][] grid, int x, int y, int empty) {
        if (x < 0 || x >= grid.length || y < 0 || y >= grid[0].length || grid[x][y] == -1) {
            return 0;
        }
        if (grid[x][y] == 2) {
            return empty == 0 ? 1 : 0;
        }

        grid[x][y] = -1;
        int paths = dfs(grid, x + 1, y, empty - 1) + dfs(grid, x - 1, y, empty - 1)
            + dfs(grid, x, y + 1, empty - 1) + dfs(grid, x, y - 1, empty - 1);
        grid[x][y] = 0;

        return paths;
    }
}

class Solution {
    public String shiftingLetters(String s, int[] shifts) {
        char[] charArray = s.toCharArray();
        int shiftSum = 0;

        for (int i = shifts.length - 1; i >= 0; i--) {
            shiftSum = (shiftSum + shifts[i]) % 26;
            charArray[i] = (char) ('a' + (charArray[i] - 'a' + shiftSum) % 26);
        }

        return new String(charArray);
    }
}

