class Solution {
    public int[] getCoprimes(int[] nums, int[][] edges) {
        List<Integer>[] graph = new ArrayList[50];
        for (int i = 0; i < 50; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int[] edge : edges) {
            graph[edge[0]].add(edge[1]);
            graph[edge[1]].add(edge[0]);
        }

        Map<Integer, List<Integer>> valueToIndex = new HashMap<>();
        for (int i = 1; i <= 50; i++) {
            valueToIndex.put(i, new ArrayList<>());
        }
        for (int i = 0; i < nums.length; i++) {
            valueToIndex.get(nums[i]).add(i);
        }

        int[] ans = new int[nums.length];
        Arrays.fill(ans, -1);

        dfs(0, -1, graph, nums, valueToIndex, ans);

        return ans;
    }

    private void dfs(int node, int parent, List<Integer>[] graph, int[] nums, Map<Integer, List<Integer>> valueToIndex, int[] ans) {
        int closestAncestor = -1;
        int minDistance = Integer.MAX_VALUE;

        for (int value : valueToIndex.keySet()) {
            if (gcd(value, nums[node]) != 1) {
                continue;
            }
            if (valueToIndex.get(value).size() > 0) {
                int ancestor = valueToIndex.get(value).get(valueToIndex.get(value).size() - 1);
                if (Math.abs(node - ancestor) < minDistance) {
                    minDistance = Math.abs(node - ancestor);
                    closestAncestor = ancestor;
                }
            }
        }

        ans[node] = closestAncestor;

        for (int child : graph[node]) {
            if (child != parent) {
                dfs(child, node, graph, nums, valueToIndex, ans);
            }
        }
    }

    private int gcd(int a, int b) {
        if (a == 0) return b;
        return gcd(b % a, a);
    }
}

