public class Solution {
    public int[] gridIllumination(int n, int[][] lamps, int[][] queries) {
        int[] ans = new int[queries.length];
        Set<Integer> rows = new HashSet<>();
        Set<Integer> cols = new HashSet<>();
        Set<Integer> diag1 = new HashSet<>();
        Set<Integer> diag2 = new HashSet<>();
        Map<Integer, Integer> lampCount = new HashMap<>();

        for (int[] lamp : lamps) {
            int r = lamp[0];
            int c = lamp[1];
            rows.add(r);
            cols.add(c);
            diag1.add(r - c);
            diag2.add(r + c);
            int key = r * n + c;
            lampCount.put(key, lampCount.getOrDefault(key, 0) + 1);
        }

        int[] dr = {0, 0, 1, -1, 1, -1, 1, -1};
        int[] dc = {1, -1, 0, 0, 1, -1, -1, 1};

        for (int i = 0; i < queries.length; i++) {
            int r = queries[i][0];
            int c = queries[i][1];

            if (rows.contains(r) || cols.contains(c) || diag1.contains(r - c) || diag2.contains(r + c)) {
                ans[i] = 1;
            }

            for (int k = 0; k < 8; k++) {
                int nr = r + dr[k];
                int nc = c + dc[k];
                int key = nr * n + nc;
                if (lampCount.containsKey(key)) {
                    lampCount.put(key, lampCount.get(key) - 1);
                    if (lampCount.get(key) == 0) {
                        lampCount.remove(key);
                    }
                }
            }
        }

        return ans;
    }
}

