public class Solution {
    public int kSimilarity(String s1, String s2) {
        if (s1.equals(s2)) {
            return 0;
        }

        Set<String> visited = new HashSet<>();
        Queue<String> queue = new LinkedList<>();
        queue.offer(s1);
        visited.add(s1);

        int k = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                String curr = queue.poll();
                if (curr.equals(s2)) {
                    return k;
                }
                List<String> neighbors = getNeighbors(curr, s2);
                for (String neighbor : neighbors) {
                    if (!visited.contains(neighbor)) {
                        queue.offer(neighbor);
                        visited.add(neighbor);
                    }
                }
            }
            k++;
        }

        return -1;
    }

    private List<String> getNeighbors(String s, String target) {
        List<String> neighbors = new ArrayList<>();
        int i = 0;
        while (s.charAt(i) == target.charAt(i)) {
            i++;
        }
        char[] arr = s.toCharArray();
        for (int j = i + 1; j < s.length(); j++) {
            if (s.charAt(j) == target.charAt(i) && s.charAt(j) != target.charAt(j)) {
                swap(arr, i, j);
                neighbors.add(new String(arr));
                swap(arr, i, j);
            }
        }
        return neighbors;
    }

    private void swap(char[] arr, int i, int j) {
        char temp = arr[i];
        arr[i] = arr[j];
        arr[j] = temp;
    }
}

