private void dfs(int[][] grid, int r, int c, int originalColor, int color, boolean[][] visited) {
    if (r < 0 || r >= grid.length || c < 0 || c >= grid[0].length || grid[r][c] != originalColor || visited[r][c]) {
        return;
    }

    visited[r][c] = true;
    if (r == 0 || r == grid.length - 1 || c == 0 || c == grid[0].length - 1 ||
        grid[r - 1][c] != originalColor || grid[r + 1][c] != originalColor ||
        grid[r][c - 1] != originalColor || grid[r][c + 1] != originalColor) {
        grid[r][c] = color;
    }

    dfs(grid, r + 1, c, originalColor, color, visited);
    dfs(grid, r - 1, c, originalColor, color, visited);
    dfs(grid, r, c + 1, originalColor, color, visited);
    dfs(grid, r, c - 1, originalColor, color, visited);
}

