public int numberOfArrays(String s, int k) {
    int n = s.length();
    int mod = 1000000007;
    long[] dp = new long[n + 1];
    dp[0] = 1;

    for (int i = 1; i <= n; i++) {
        for (int j = 1; j <= k && j <= i; j++) {
            if (s.charAt(i - j) == '0') {
                continue;
            }
            long num = Long.parseLong(s.substring(i - j, i));
            if (num >= 1 && num <= k) {
                dp[i] = (dp[i] + dp[i - j]) % mod;
            }
        }
    }

    return (int) dp[n];
}

public int tallestBillboard(int[] rods) {
    int[] dp = new int[10001];
    Arrays.fill(dp, -1);
    dp[0] = 0;

    for (int rod : rods) {
        int[] curr = dp.clone();
        for (int diff = -5000; diff <= 5000; diff++) {
            if (dp[diff + 5000] >= 0) {
                curr[diff + rod + 5000] = Math.max(curr[diff + rod + 5000], dp[diff + 5000]);
                curr[Math.abs(diff - rod) + 5000] = Math.max(curr[Math.abs(diff - rod) + 5000], dp[diff + 5000] + Math.min(diff, rod));
            }
        }
        dp = curr;
    }

    return dp[5000];
}

