public int[] advantageCount(int[] nums1, int[] nums2) {
        Arrays.sort(nums1);
        int[] sortedNums2 = Arrays.copyOf(nums2, nums2.length);
        Arrays.sort(sortedNums2);

        Map<Integer, Deque<Integer>> numIndexMap = new HashMap<>();
        for (int num : nums2) {
            numIndexMap.put(num, new LinkedList<>());
        }

        Deque<Integer> remainingNums = new LinkedList<>();
        int j = 0;
        for (int num : sortedNums2) {
            while (j < nums1.length && nums1[j] <= num) {
                remainingNums.add(nums1[j]);
                j++;
            }
            if (j < nums1.length) {
                numIndexMap.get(num).add(nums1[j]);
                j++;
            }
        }

        int[] result = new int[nums1.length];
        for (int i = 0; i < nums2.length; i++) {
            if (numIndexMap.get(nums2[i]).isEmpty()) {
                result[i] = remainingNums.poll();
            } else {
                result[i] = numIndexMap.get(nums2[i]).poll();
            }
        }

