public int[] findDiagonalOrder(int[][] mat) {
    if (mat == null || mat.length == 0) {
        return new int[0];
    }

    int m = mat.length;
    int n = mat[0].length;
    int[] result = new int[m * n];
    int row = 0, col = 0;

    for (int i = 0; i < m * n; i++) {
        result[i] = mat[row][col];
        if ((row + col) % 2 == 0) {
            if (col == n - 1) {
                row++;
            } else if (row == 0) {
                col++;
            } else {
                row--;
                col++;
            }
        } else {
            if (row == m - 1) {
                col++;
            } else if (col == 0) {
                row++;
            } else {
                row++;
                col--;
            }
        }
    }

    return result;
}

public int rectangleArea(int[][] rectangles) {
    long result = 0;
    int mod = 1000000007;
    List<int[]> points = new ArrayList<>();

    for (int[] rect : rectangles) {
        points.add(new int[]{rect[0], rect[1], 1});
        points.add(new int[]{rect[0], rect[3], -1});
        points.add(new int[]{rect[2], rect[1], -1});
        points.add(new int[]{rect[2], rect[3], 1});
    }

    Collections.sort(points, (a, b) -> Integer.compare(a[0], b[0]));

    List<int[]> active = new ArrayList<>();
    int preX = -1;
    int preY = -1;

    for (int[] point : points) {
        int x = point[0], y = point[1], val = point[2];
        result += (long) helper(active) * (x - preX);
        result %= mod;
        preX = x;

        if (val == 1) {
            active.add(new int[]{y, val});
            Collections.sort(active, (a, b) -> Integer.compare(a[0], b[0]));
        } else {
            active.remove(new int[]{y, -1});
        }

        result += (long) helper(active) * (y - preY);
        result %= mod;
        preY = y;
    }

    return (int) result;
}

private int helper(List<int[]> active) {
    int result = 0;
    int pre = -1;
    for (int[] act : active) {
        int cur = act[0], val = act[1];
        if (pre >= 0 && val > 0) {
            result += cur - pre;
        }
        pre = cur;
    }
    return result;
}

