public double[] calcEquation(List<List<String>> equations, double[] values, List<List<String>> queries) {
    Map<String, Map<String, Double>> graph = new HashMap<>();

    for (int i = 0; i < equations.size(); i++) {
        String a = equations.get(i).get(0);
        String b = equations.get(i).get(1);
        double val = values[i];

        if (!graph.containsKey(a)) {
            graph.put(a, new HashMap<>());
        }
        graph.get(a).put(b, val);

        if (!graph.containsKey(b)) {
            graph.put(b, new HashMap<>());
        }
        graph.get(b).put(a, 1 / val);
    }

    double[] result = new double[queries.size()];
    for (int i = 0; i < queries.size(); i++) {
        String start = queries.get(i).get(0);
        String end = queries.get(i).get(1);
        result[i] = dfs(graph, start, end, 1, new HashSet<>());
    }

    return result;
}

private double dfs(Map<String, Map<String, Double>> graph, String start, String end, double value, Set<String> visited) {
    if (!graph.containsKey(start) || !visited.add(start)) {
        return -1.0;
    }

    if (start.equals(end)) {
        return value;
    }

    Map<String, Double> neighbors = graph.get(start);
    for (String neighbor : neighbors.keySet()) {
        double next = dfs(graph, neighbor, end, value * neighbors.get(neighbor), visited);
        if (next != -1.0) {
            return next;
        }
    }

    visited.remove(start);
    return -1.0;
}

public String convert(String s, int numRows) {
    if (numRows == 1) return s;

    List<StringBuilder> rows = new ArrayList<>();
    for (int i = 0; i < Math.min(numRows, s.length()); i++) {
        rows.add(new StringBuilder());
    }

    int curRow = 0;
    boolean goingDown = false;

    for (char c : s.toCharArray()) {
        rows.get(curRow).append(c);
        if (curRow == 0 || curRow == numRows - 1) goingDown = !goingDown;
        curRow += goingDown ? 1 : -1;
    }

    StringBuilder result = new StringBuilder();
    for (StringBuilder row : rows) {
        result.append(row);
    }

    return result.toString();
}

class Solution {
    public int countSubIslands(int[][] grid1, int[][] grid2) {
        int count = 0;
        for (int i = 0; i < grid2.length; i++) {
            for (int j = 0; j < grid2[0].length; j++) {
                if (grid2[i][j] == 1 && isSubIsland(grid1, grid2, i, j)) {
                    count++;
                }
            }
        }
        return count;
    }

    private boolean isSubIsland(int[][] grid1, int[][] grid2, int i, int j) {
        if (i < 0 || i >= grid2.length || j < 0 || j >= grid2[0].length || grid2[i][j] == 0) {
            return true;
        }

        if (grid1[i][j] == 0) {
            return false;
        }

        grid1[i][j] = 0;

        boolean result = true;
        result &= isSubIsland(grid1, grid2, i + 1, j);
        result &= isSubIsland(grid1, grid2, i - 1, j);
        result &= isSubIsland(grid1, grid2, i, j + 1);
        result &= isSubIsland(grid1, grid2, i, j - 1);

        return result;
    }
}

