public List<List<String>> printTree(TreeNode root) {
    int height = getHeight(root);
    int rows = height + 1;
    int cols = (int) Math.pow(2, height) - 1;
    List<List<String>> res = new ArrayList<>();
    for (int i = 0; i < rows; i++) {
        List<String> row = new ArrayList<>();
        for (int j = 0; j < cols; j++) {
            row.add("");
        }
        res.add(row);
    }
    populateRes(root, res, 0, (cols - 1) / 2, height);
    return res;
}

private void populateRes(TreeNode node, List<List<String>> res, int row, int col, int height) {
    if (node == null) {
        return;
    }
    res.get(row).set(col, String.valueOf(node.val));
    populateRes(node.left, res, row + 1, col - (int) Math.pow(2, height - row - 2), height);
    populateRes(node.right, res, row + 1, col + (int) Math.pow(2, height - row - 2), height);
}

private int getHeight(TreeNode node) {
    if (node == null) {
        return 0;
    }
    return 1 + Math.max(getHeight(node.left), getHeight(node.right));
}

public int[] singleNumber(int[] nums) {
        int xor = 0;
        for (int num : nums) {
            xor ^= num;
        }

        int mask = 1;
        while ((xor & mask) == 0) {
            mask <<= 1;
        }

        int num1 = 0;
        int num2 = 0;
        for (int num : nums) {
            if ((num & mask) == 0) {
                num1 ^= num;
            } else {
                num2 ^= num;
            }
        }

        return new int[]{num1, num2};
    }

public int[] threeEqualParts(int[] arr) {
    int countOnes = 0;
    for (int num : arr) {
        if (num == 1) {
            countOnes++;
        }
    }

    if (countOnes % 3 != 0) {
        return new int[] {-1, -1};
    }

    if (countOnes == 0) {
        return new int[] {0, arr.length - 1};
    }

    int onesInEachPart = countOnes / 3;
    int firstEnd = findEnd(arr, onesInEachPart);
    int secondEnd = findEnd(arr, onesInEachPart * 2);

    while (secondEnd < arr.length && arr[firstEnd] == arr[secondEnd] && arr[firstEnd] == arr[arr.length - 1]) {
        firstEnd++;
        secondEnd++;
    }

    if (secondEnd == arr.length) {
        return new int[] {firstEnd - 1, secondEnd};
    } else {
        return new int[] {-1, -1};
    }
}

private int findEnd(int[] arr, int targetOnes) {
    int count = 0;
    for (int i = 0; i < arr.length; i++) {
        if (arr[i] == 1) {
            count++;
        }
        if (count == targetOnes) {
            return i;
        }
    }
    return -1;
}

