public class Solution {
    public int orderOfLargestPlusSign(int n, int[][] mines) {
        int[][] grid = new int[n][n];
        for (int i = 0; i < n; i++) {
            Arrays.fill(grid[i], 1);
        }
        for (int[] mine : mines) {
            grid[mine[0]][mine[1]] = 0;
        }

        int[][][] dp = new int[n][n][4];
        int order = 0;

        for (int i = 0; i < n; i++) {
            int left = 0, right = 0, up = 0, down = 0;
            for (int j = 0, k = n - 1; j < n; j++, k--) {
                left = (grid[i][j] == 1) ? left + 1 : 0;
                dp[i][j][0] = left;

                right = (grid[i][k] == 1) ? right + 1 : 0;
                dp[i][k][1] = right;

                up = (grid[j][i] == 1) ? up + 1 : 0;
                dp[j][i][2] = up;

                down = (grid[k][i] == 1) ? down + 1 : 0;
                dp[k][i][3] = down;
            }
        }

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                int minArmLength = Integer.MAX_VALUE;
                for (int k = 0; k < 4; k++) {
                    minArmLength = Math.min(minArmLength, dp[i][j][k]);
                }
                order = Math.max(order, minArmLength);
            }
        }

        return order;
    }
}

