    int n = nums.length;
    int count = 0;

    for (int i = 0; i < n - 2; i++) {
        int diff = nums[i + 1] - nums[i];
        for (int j = i + 2; j < n; j++) {
            boolean isArithmetic = true;
            for (int k = i + 1; k <= j; k++) {
                if (nums[k] - nums[k - 1] != diff) {
