private boolean isMatch(String query, String pattern) {
    int i = 0;
    int j = 0;
    while (i < query.length() && j < pattern.length()) {
        if (query.charAt(i) == pattern.charAt(j)) {
            i++;
            j++;
        } else if (Character.isUpperCase(query.charAt(i))) {
            return false;
        } else {
            i++;
        }
    }
    if (j == pattern.length()) {
        while (i < query.length()) {
