    public int nthMagicalNumber(int n, int a, int b) {
        long lcm = ((long) a * b) / gcd(a, b);
        long low = 0, high = (long) 1e18;
        long mod = (long) 1e9 + 7;

        while (low < high) {
            long mid = low + (high - low) / 2;
            long count = mid / a + mid / b - mid / lcm;

            if (count < n) {
                low = mid + 1;
            } else {
                high = mid;
            }
        }

        return (int) (low % mod);
    }

