                result[i] = caseInsensitiveMap.get(query.toLowerCase());
            } else if (vowelErrorsMap.containsKey(getVowelErrorsKey(query))) {
                result[i] = vowelErrorsMap.get(getVowelErrorsKey(query));
            } else {
                result[i] = "";
            }
            i++;
        }

