public class Solution {
    public void solve(char[][] board) {
        if (board == null || board.length == 0) {
            return;
        }

        int rows = board.length;
        int cols = board[0].length;

        for (int i = 0; i < rows; i++) {
            if (board[i][0] == 'O') {
                dfs(board, i, 0);
            }
            if (board[i][cols - 1] == 'O') {
                dfs(board, i, cols - 1);
            }
        }

        for (int j = 0; j < cols; j++) {
            if (board[0][j] == 'O') {
                dfs(board, 0, j);
            }
            if (board[rows - 1][j] == 'O') {
                dfs(board, rows - 1, j);
            }
        }

        for (int i = 0; i < rows; i++) {
            for (int j = 0; j < cols; j++) {
                if (board[i][j] == 'O') {
                    board[i][j] = 'X';
                } else if (board[i][j] == '#') {
                    board[i][j] = 'O';
                }
            }
        }
    }

    private void dfs(char[][] board, int i, int j) {
        if (i < 0 || i >= board.length || j < 0 || j >= board[0].length || board[i][j] != 'O') {
            return;
        }

        board[i][j] = '#';

        dfs(board, i + 1, j);
        dfs(board, i - 1, j);
        dfs(board, i, j + 1);
        dfs(board, i, j - 1);
    }
}

public class Solution {
    public String solveEquation(String equation) {
        String[] parts = equation.split("=");

        int[] left = evaluate(parts[0]);
        int[] right = evaluate(parts[1]);

        int coef = left[0] - right[0];
        int val = right[1] - left[1];

        if (coef == 0 && val == 0) {
            return "Infinite solutions";
        } else if (coef == 0) {
            return "No solution";
        } else {
            return "x=" + (val / coef);
        }
    }

    private int[] evaluate(String str) {
        String[] tokens = str.split("(?=[-+])");
        int coef = 0;
        int val = 0;

        for (String token : tokens) {
            if (token.equals("+x") || token.equals("x")) {
                coef += 1;
            } else if (token.equals("-x")) {
                coef -= 1;
            } else if (token.contains("x")) {
                coef += Integer.parseInt(token.substring(0, token.indexOf("x")));
            } else {
                val += Integer.parseInt(token);
            }
        }

        return new int[]{coef, val};
    }
}

