public class Solution {
    public int snakesAndLadders(int[][] board) {
        int n = board.length;
        int target = n * n;
        Queue<Integer> queue = new LinkedList<>();
        Set<Integer> visited = new HashSet<>();
        queue.offer(1);
        visited.add(1);
        int moves = 0;

        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                int curr = queue.poll();
                if (curr == target) {
                    return moves;
                }
                for (int j = 1; j <= 6 && curr + j <= target; j++) {
                    int next = curr + j;
                    int[] coordinates = getCoordinates(next, n);
                    int nextValue = board[coordinates[0]][coordinates[1]] == -1 ? next : board[coordinates[0]][coordinates[1];
                    if (!visited.contains(nextValue)) {
                        queue.offer(nextValue);
                        visited.add(nextValue);
                    }
                }
            }
            moves++;
        }

        return -1;
    }

    private int[] getCoordinates(int num, int n) {
        int row = (num - 1) / n;
        int col = (num - 1) % n;
        if (row % 2 == 1) {
            col = n - 1 - col;
        }
        row = n - 1 - row;
        return new int[]{row, col};
    }
}

