public int minRefill(int[] plants, int capacityA, int capacityB) {
    int n = plants.length;
    int left = 0, right = n - 1;
    int waterA = capacityA, waterB = capacityB;
    int refills = 0;

    while (left <= right) {
        if (waterA < plants[left]) {
            waterA = capacityA;
            refills++;
        } else {
            waterA -= plants[left];
            left++;
        }

        if (waterB < plants[right]) {
            waterB = capacityB;
            refills++;
        } else {
            waterB -= plants[right];
            right--;
        }
    }

    return refills;
}
