public int minDistance(int[] houses, int k) {
    Arrays.sort(houses);
    int n = houses.length;
    int[][] dp = new int[n + 1][k + 1];
    for(int i = 0; i <= n; i++) {
        Arrays.fill(dp[i], Integer.MAX_VALUE);
    }
    dp[0][0] = 0;
    for(int i = 1; i <= n; i++) {
        for(int j = 1; j <= Math.min(i, k); j++) {
            for(int l = i - 1; l >= 0; l--) {
                int median = (i + l) / 2;
                int mailbox = houses[median];
                int cost = 0;
                for(int m = l; m < i; m++) {
                    cost += Math.abs(houses[m] - mailbox);
                }
                dp[i][j] = Math.min(dp[i][j], dp[l][j - 1] + cost);
            }
        }
    }
    return dp[n][k];
}

