class Solution {
    public ListNode insertionSortList(ListNode head) {
        if (head == null || head.next == null) {
            return head;
        }

        ListNode dummy = new ListNode(0);
        dummy.next = head;
        ListNode prev = head;
        ListNode curr = head.next;

        while (curr != null) {
            if (curr.val < prev.val) {
                ListNode temp = dummy;
                while (temp.next.val < curr.val) {
                    temp = temp.next;
                }
                prev.next = curr.next;
                curr.next = temp.next;
                temp.next = curr;
                curr = prev.next;
            } else {
                prev = curr;
                curr = curr.next;
            }
        }

        return dummy.next;
    }
}

