class Solution {
    public int minNumberOfSemesters(int n, int[][] relations, int k) {
        int[] pre = new int[n];
        int[] dp = new int[1 << n];
        Arrays.fill(dp, n);
        for (int[] r : relations) {
            pre[r[1] - 1] |= 1 << (r[0] - 1);
        }
        for (int i = 1; i < 1 << n; i++) {
            int canTake = 0;
            for (int j = 0; j < n; j++) {
                if ((i & pre[j]) == pre[j] && (i & (1 << j)) == 0) {
                    canTake |= 1 << j;
                }
            }
            for (int sub = i; sub > 0; sub = (sub - 1) & i) {
                if (Integer.bitCount(sub) <= k) {
                    dp[i] = Math.min(dp[i], dp[i ^ sub] + 1);
                }
                sub = sub == 0 ? -1 : sub;
            }
            dp[i] = Math.min(dp[i], dp[i & ~canTake] + 1);
        }
        return dp[(1 << n) - 1];
    }
}

