class Solution {
    public TreeNode addOneRow(TreeNode root, int val, int depth) {
        if (depth == 1) {
            TreeNode newRoot = new TreeNode(val);
            newRoot.left = root;
            return newRoot;
        }

        Queue<TreeNode> queue = new LinkedList<>();
        queue.offer(root);
        int currentDepth = 1;

        while (currentDepth < depth - 1) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                TreeNode current = queue.poll();
                if (current.left != null) {
                    queue.offer(current.left);
                }
                if (current.right != null) {
                    queue.offer(current.right);
                }
            }
            currentDepth++;
        }

        while (!queue.isEmpty()) {
            TreeNode current = queue.poll();
            TreeNode temp = current.left;
            current.left = new TreeNode(val);
            current.left.left = temp;
            temp = current.right;
            current.right = new TreeNode(val);
            current.right.right = temp;
        }

        return root;
    }
}

public String reformatString(String s) {
    List<Character> letters = new ArrayList<>();
    List<Character> digits = new ArrayList<>();

    for (char c : s.toCharArray()) {
        if (Character.isLetter(c)) {
            letters.add(c);
        } else {
            digits.add(c);
        }
    }

    if (Math.abs(letters.size() - digits.size()) > 1) {
        return "";
    }

    List<Character> result = new ArrayList<>();
    int i = 0, j = 0;
    boolean letterFirst = letters.size() > digits.size();

    while (i < letters.size() || j < digits.size()) {
        if (letterFirst) {
            result.add(letters.get(i++));
        } else {
            result.add(digits.get(j++));
        }

        letterFirst = !letterFirst;
    }

    return result.stream().map(String::valueOf).collect(Collectors.joining());
}

