class Solution {
    public String alphabetBoardPath(String target) {
        StringBuilder sb = new StringBuilder();
        int row = 0, col = 0;

        for(char c : target.toCharArray()) {
            int newRow = (c - 'a') / 5;
            int newCol = (c - 'a') % 5;

            while(newRow < row) {
                sb.append('U');
                row--;
            }

            while(newCol < col) {
                sb.append('L');
                col--;
            }

            while(newCol > col) {
                sb.append('R');
                col++;
            }

            while(newRow > row) {
                sb.append('D');
                row++;
            }

            sb.append('!');
        }

        return sb.toString();
    }
}

public int swimInWater(int[][] grid) {
        int n = grid.length;
        int[][] directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
        boolean[][] visited = new boolean[n][n];
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> grid[a[0]][a[1]] - grid[b[0]][b[1]]);
        pq.offer(new int[]{0, 0});
        int res = 0;

        while (!pq.isEmpty()) {
            int[] curr = pq.poll();
            int x = curr[0];
            int y = curr[1];
            res = Math.max(res, grid[x][y]);
            if (x == n - 1 && y == n - 1) {
                return res;
            }
            visited[x][y] = true;

            for (int[] dir : directions) {
                int newX = x + dir[0];
                int newY = y + dir[1];
                if (newX >= 0 && newX < n && newY >= 0 && newY < n && !visited[newX][newY]) {
                    pq.offer(new int[]{newX, newY});
                    visited[newX][newY] = true;
                }
            }
        }

        return -1;
    }

class Solution {
    public int largestMagicSquare(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        int maxMagic = 1;
        int[][] rowSum = new int[m + 1][n + 1];
        int[][] colSum = new int[m + 1][n + 1];
        int[][] diagSum = new int[m + 1][n + 1];

        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                rowSum[i][j] = rowSum[i][j - 1] + grid[i - 1][j - 1];
                colSum[i][j] = colSum[i - 1][j] + grid[i - 1][j - 1];
                diagSum[i][j] = diagSum[i - 1][j - 1] + grid[i - 1][j - 1];
            }
        }

        for (int k = 2; k <= Math.min(m, n); k++) {
            for (int i = 1; i <= m - k + 1; i++) {
                for (int j = 1; j <= n - k + 1; j++) {
                    int sum = diagSum[i + k - 1][j + k - 1] - diagSum[i - 1][j - 1];
                    boolean isMagic = true;

                    for (int l = 0; l < k && isMagic; l++) {
                        if (rowSum[i + l][j + k - 1] - rowSum[i + l][j - 1] != sum ||
                            colSum[i + k - 1][j + l] - colSum[i - 1][j + l] != sum) {
                            isMagic = false;
                        }
                    }

                    if (isMagic) {
                        maxMagic = k;
                    }
                }
            }
        }

        return maxMagic;
    }
}

