    for (int i = 1; i <= n; i++) {
        for (int j = 1; j < slices.length; j++) {
            dp[i][j] = Math.max(dp[i][j - 1], (j >= 2 ? dp[i - 1][j - 2] : 0) + slices[j - 1]);
        }
    }

    int max = 0;
    for (int i = 0; i < slices.length - 1; i++) {
        max = Math.max(max, dp[n][i]);
    }

    return max;
}

public int maxPoints(int[][] points) {
    if (points.length < 3) {
        return points.length;
    }

    int maxPoints = 0;

    for (int i = 0; i < points.length; i++) {
        Map<Double, Integer> slopeMap = new HashMap<>();
        int samePoint = 0;
        int sameX = 1;

        for (int j = 0; j < points.length; j++) {
            if (i != j) {
                if (points[i][0] == points[j][0] && points[i][1] == points[j][1]) {
                    samePoint++;
                } else if (points[i][0] == points[j][0]) {
                    sameX++;
                } else {
                    double slope = points[i][1] == points[j][1] ? 0.0 : (double) (points[j][1] - points[i][1]) / (double) (points[j][0] - points[i][0]);
                    slopeMap.put(slope, slopeMap.getOrDefault(slope, 1) + 1);
                    maxPoints = Math.max(maxPoints, slopeMap.get(slope));
                }
            }
        }

        maxPoints = Math.max(maxPoints, sameX + samePoint);
    }

    return maxPoints;
}

