class Solution {
    public int minNumberOfMonths(int n, int[][] relations, int[] time) {
        Map<Integer, List<Integer>> graph = new HashMap<>();
        int[] indegree = new int[n];
        int[] dp = new int[n];

        for (int[] relation : relations) {
            int prevCourse = relation[0] - 1;
            int nextCourse = relation[1] - 1;
            graph.computeIfAbsent(prevCourse, k -> new ArrayList<>()).add(nextCourse);
            indegree[nextCourse]++;
        }

        Queue<Integer> queue = new LinkedList<>();
        for (int i = 0; i < n; i++) {
            if (indegree[i] == 0) {
                queue.offer(i);
                dp[i] = time[i];
            }
        }

        int months = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            months++;
            for (int i = 0; i < size; i++) {
                int currCourse = queue.poll();
                if (graph.containsKey(currCourse)) {
                    for (int nextCourse : graph.get(currCourse)) {
                        indegree[nextCourse]--;
                        if (indegree[nextCourse] == 0) {
                            queue.offer(nextCourse);
                        }
                        dp[nextCourse] = Math.max(dp[nextCourse], dp[currCourse] + time[nextCourse]);
                    }
                }
            }
        }

        return Arrays.stream(dp).max().getAsInt();
    }
}

