public int[] findDiagonalOrder(int[][] nums) {
    if (nums == null || nums.length == 0) {
        return new int[0];
    }

    int rows = nums.length;
    int cols = nums[0].length;
    int[] result = new int[rows * cols];
    int row = 0, col = 0;

    for (int i = 0; i < result.length; i++) {
        result[i] = nums[row][col];

        if ((row + col) % 2 == 0) {
            if (col == cols - 1) {
                row++;
            } else if (row == 0) {
                col++;
            } else {
                row--;
                col++;
            }
        } else {
            if (row == rows - 1) {
                col++;
            } else if (col == 0) {
                row++;
            } else {
                row++;
                col--;
            }
        }
    }

    return result;
}

