public int[] countPairs(int n, int[][] edges, int[] queries) {
    int[] cnt = new int[n + 1];
    int[] edgeCnt = new int[2 * edges.length + 1];
    for (int[] e : edges) {
        cnt[e[0]]++;
        cnt[e[1]]++;
        edgeCnt[cnt[e[0]] + cnt[e[1]] - 1]++;
    }
    Arrays.sort(cnt);
    int max = cnt[n];
    int[] sorted = Arrays.copyOfRange(cnt, 1, n + 1);
    Arrays.sort(sorted);
    int l = 0, r = n - 1;
    while (l < r) {
        if (sorted[l] + sorted[r] > max) {
            edgeCnt[sorted[l] + sorted[r]]--;
            r--;
        } else {
            l++;
        }
    }
    for (int i = max - 1; i > 0; i--) {
        edgeCnt[i] += edgeCnt[i + 1];
    }
    int[] res = new int[queries.length];
    for (int i = 0; i < queries.length; i++) {
        res[i] = edgeCnt[Math.max(0, queries[i] + 1)];
    }
    return res;
}

class Solution {
    public int[] findRedundantConnection(int[][] edges) {
        int[] parent = new int[edges.length + 1];
        for (int i = 0; i < parent.length; i++) {
            parent[i] = i;
        }

        for (int[] edge : edges) {
            int root1 = find(parent, edge[0]);
            int root2 = find(parent, edge[1]);
            if (root1 == root2) {
                return edge;
            }
            parent[root1] = root2;
        }

        return new int[0];
    }

    public int find(int[] parent, int node) {
        while (parent[node] != node) {
            node = parent[node];
        }
        return node;
    }
}

public class Solution {
    public int closestCost(int[] baseCosts, int[] toppingCosts, int target) {
        Set<Integer> costs = new HashSet<>();
        for (int base : baseCosts) {
            costs.add(base);
        }
        for (int topping : toppingCosts) {
            Set<Integer> newCosts = new HashSet<>();
            for (int cost : costs) {
                newCosts.add(cost);
                newCosts.add(cost + topping);
                newCosts.add(cost + 2 * topping);
            }
            costs.addAll(newCosts);
        }
        int closest = Integer.MAX_VALUE;
        for (int cost : costs) {
            if (Math.abs(cost - target) < Math.abs(closest - target) || (Math.abs(cost - target) == Math.abs(closest - target) && cost < closest)) {
                closest = cost;
            }
        }
        return closest;
    }
}

public class Solution {
    public ListNode detectCycle(ListNode head) {
