            return null;
        }

        ListNode slow = head;
        ListNode fast = head;

        while (fast != null && fast.next != null) {
            slow = slow.next;
            fast = fast.next.next;

            if (slow == fast) {
                ListNode slow2 = head;
                while (slow2 != slow) {
                    slow2 = slow2.next;
                    slow = slow.next;
                }
                return slow2;
            }
        }

        return null;
    }
}

public int sumOfFlooredPairs(int[] nums) {
    int MOD = 1000000007;
    int maxNum = Arrays.stream(nums).max().getAsInt();
    int[] freq = new int[maxNum + 1];

    for (int num : nums) {
        freq[num]++;
    }

    long[] prefixSum = new long[maxNum + 1];
    for (int i = 1; i <= maxNum; i++) {
        prefixSum[i] = prefixSum[i - 1] + freq[i];
    }

    long res = 0;
    for (int i = 0; i < nums.length; i++) {
        for (int j = 1; j <= maxNum; j++) {
            if (freq[j] > 0) {
                res = (res + freq[j] * (prefixSum[Math.min(maxNum, (nums[i] / j) + 1)] - prefixSum[j])) % MOD;
            }
        }
    }

    return (int) res;
}

