    public int countSequences(int[] rollMax, int n) {
        int MOD = 1000000007;
        long[][] dp = new long[n + 1][7];
        long total = 0;
        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= 6; j++) {
                if (i == 1) {
                    dp[i][j] = 1;
                } else {
                    for (int k = 1; k <= 6; k++) {
                        if (k != j) {
                            for (int l = 1; l <= rollMax[k - 1] && i - l >= 1; l++) {
                                dp[i][j] = (dp[i][j] + dp[i - l][k]) % MOD;
                            }
                        }
                    }
                }
                total = (total + dp[i][j]) % MOD;
            }
        }
        return (int) total;
    }
}

