    for (int i = 0; i < n - 1; i++) {
        int diff = words[0].charAt(i + 1) - words[0].charAt(i);

        boolean found = true;
        for (int j = 1; j < words.length; j++) {
            if (words[j].charAt(i + 1) - words[j].charAt(i) != diff) {
                found = false;
                break;
            }
        }

        if (!found) {
            for (String word : words) {
                int tempDiff = word.charAt(i + 1) - word.charAt(i);
                if (tempDiff != diff) {
                    return word;
                }
            }
        }
    }

    return "";
}

