public class Solution {
    public List<String> ambiguousCoordinates(String s) {
        List<String> result = new ArrayList<>();
        for (int i = 2; i < s.length() - 1; i++) {
            for (String left : make(s, 1, i)) {
                for (String right : make(s, i, s.length() - 1)) {
                    result.add("(" + left + ", " + right + ")");
                }
            }
        }
        return result;
    }

    private List<String> make(String s, int i, int j) {
        List<String> res = new ArrayList<>();
        for (int d = 1; d <= j - i; d++) {
            String left = s.substring(i, i + d);
            String right = s.substring(i + d, j);
            if ((left.charAt(0) != '0' || left.equals("0")) && !right.endsWith("0")) {
                if (j - i == 1 || !right.startsWith("0")) {
                    res.add(left + (d < j - i ? "." : "") + right);
                }
            }
        }
        return res;
    }
