class Solution {
    public int[] movesToStamp(String stamp, String target) {
        List<Integer> res = new ArrayList<>();
        char[] s = target.toCharArray();
        char[] t = stamp.toCharArray();
        boolean[] visited = new boolean[s.length];
        boolean changed = true;

        while (changed) {
            changed = false;
            for (int i = 0; i <= s.length - t.length; i++) {
                boolean match = false;
                for (int j = 0; j < t.length; j++) {
                    if (!visited[i + j] && (s[i + j] == t[j] || s[i + j] == '?')) {
                        match = true;
                    } else {
                        match = false;
                        break;
                    }
                }
                if (match) {
                    for (int j = 0; j < t.length; j++) {
                        if (!visited[i + j]) {
                            visited[i + j] = true;
                            changed = true;
                        }
                    }
                    res.add(i);
                    if (res.size() == s.length) {
                        break;
                    }
                }
            }
        }

        for (int i = 0; i < s.length; i++) {
            if (!visited[i] && s[i] != '?') {
                return new int[0];
            }
        }

        Collections.reverse(res);
        return res.stream().mapToInt(i -> i).toArray();
    }
}

public class Solution {
    public boolean makesquare(int[] matchsticks) {
        if (matchsticks == null || matchsticks.length < 4) {
            return false;
        }

        int sum = 0;
        for (int matchstick : matchsticks) {
            sum += matchstick;
        }

        if (sum % 4 != 0) {
            return false;
        }

        Arrays.sort(matchsticks);
        return canPartition(matchsticks, new int[4], sum / 4, matchsticks.length - 1);
    }

    private boolean canPartition(int[] matchsticks, int[] sums, int target, int index) {
        if (index == -1) {
            return true;
        }

        for (int i = 0; i < 4; i++) {
            if (sums[i] + matchsticks[index] > target) {
                continue;
            }

            sums[i] += matchsticks[index];
            if (canPartition(matchsticks, sums, target, index - 1)) {
                return true;
            }
            sums[i] -= matchsticks[index];
        }

        return false;
    }
}

