public class Solution {
    public int largestIsland(int[][] grid) {
        int n = grid.length;
        int[][] directions = {{1, 0}, {-1, 0}, {0, 1}, {0, -1}};
        int maxIslandSize = 0;

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 0) {
                    grid[i][j] = 1;
                    maxIslandSize = Math.max(maxIslandSize, exploreIsland(grid, i, j, directions));
                    grid[i][j] = 0;
                }
            }
        }

        return maxIslandSize == 0 ? n * n : maxIslandSize;
    }

    private int exploreIsland(int[][] grid, int i, int j, int[][] directions) {
        int n = grid.length;
        boolean[][] visited = new boolean[n][n];
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{i, j});
        visited[i][j] = true;
        int islandSize = 0;

        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            islandSize++;

            for (int[] dir : directions) {
                int newRow = curr[0] + dir[0];
                int newCol = curr[1] + dir[1];

                if (newRow >= 0 && newRow < n && newCol >= 0 && newCol < n && grid[newRow][newCol] == 1 && !visited[newRow][newCol]) {
                    queue.offer(new int[]{newRow, newCol});
                    visited[newRow][newCol] = true;
                }
            }
        }

        return islandSize;
    }
}

public class Solution {
    public int getMaxRepetitions(String s1, int n1, String s2, int n2) {
        int[][] dp = new int[s2.length()][2];
        int index = 0, count = 0;
        for(int k=0; k<n1; k++) {
            for(int i=0; i<s1.length(); i++) {
                if(s1.charAt(i) == s2.charAt(index)) {
                    index++;
                    if(index == s2.length()) {
                        index = 0;
                        count++;
                    }
                }
            }
            dp[i] = new int[]{index, count};
            for(int i=0; i<k; i++) {
                if(dp[i][0] == dp[index][0]) {
                    int pre_count = dp[i][1];
                    int pattern_count = (count - dp[i][1]) * ((n1 - i - 1) / (k - i));
                    int post_count = dp[i + (n1 - i - 1) % (k - i + 1)][1] - dp[i][1];
                    return (pre_count + pattern_count + post_count) / n2;
                }
            }
        }
        return dp[n1][1] / n2;
    }
}

