public class Solution {
    public int getMinEncodedLength(String s, int k) {
        int n = s.length();
        int[][] dp = new int[n + 1][k + 1];

        for (int i = 1; i <= n; i++) {
            for (int j = 0; j <= k; j++) {
                if (j == 0) {
                    dp[i][j] = encodeLength(s.substring(0, i));
                } else {
                    dp[i][j] = Math.min(dp[i - 1][j - 1], dp[i - 1][j] + encodeLength(s.substring(i - dp[i - 1][j], i)));
                }
            }
        }

        return dp[n][k];
    }

    private int encodeLength(String s) {
        int count = 0;
        int len = s.length();
        for (int i = 0; i < len; i++) {
            count++;
            if (i == len - 1 || s.charAt(i) != s.charAt(i + 1)) {
                count = count < 2 ? 1 : (int)(Math.log10(count) + 2);
            }
        }
        return count;
    }
}
