public int countGoodStrings(int n, String s1, String s2, String evil) {
    int MOD = 1000000007;
    int[][][] dp = new int[n][2][2];
    return dfs(0, true, true, true, n, s1, s2, evil, dp) % MOD;
}

private int dfs(int pos, boolean start1, boolean start2, boolean startEvil, int n, String s1, String s2, String evil, int[][][] dp) {
    if (pos == n) {
        return 1;
    }

    if (dp[pos][start1 ? 1 : 0][start2 ? 1 : 0] != 0) {
        return dp[pos][start1 ? 1 : 0][start2 ? 1 : 0];
    }

    int res = 0;
    char from = start1 ? s1.charAt(pos) : 'a';
    char to = start2 ? s2.charAt(pos) : 'z';
    for (char c = from; c <= to; c++) {
        if (c != evil.charAt(pos)) {
            boolean newStart1 = start1 && c == s1.charAt(pos);
            boolean newStart2 = start2 && c == s2.charAt(pos);
            boolean newStartEvil = startEvil && c == evil.charAt(pos);
            res = (res + dfs(pos + 1, newStart1, newStart2, newStartEvil, n, s1, s2, evil, dp)) % 1000000007;
        }
    }

    return dp[pos][start1 ? 1 : 0][start2 ? 1 : 0] = res;
}

