class Solution {
    public int numDecodings(String pressedKeys) {
        int MOD = 1000000007;
        long[] dp = new long[pressedKeys.length() + 1];
        dp[0] = 1;
        dp[1] = pressedKeys.charAt(0) == '0' ? 0 : pressedKeys.charAt(0) == '*' ? 9 : 1;

        for (int i = 2; i <= pressedKeys.length(); i++) {
            char prev = pressedKeys.charAt(i - 2);
            char cur = pressedKeys.charAt(i - 1);

            if (cur == '0') {
                if (prev == '1' || prev == '2') {
                    dp[i] = dp[i - 2];
                } else if (prev == '*') {
                    dp[i] = dp[i - 2] * 2 % MOD;
                } else {
                    return 0;
                }
            } else if (cur >= '1' && cur <= '9') {
                dp[i] = dp[i - 1];

                if (prev == '1' || (prev == '2' && cur <= '6')) {
                    dp[i] = (dp[i] + dp[i - 2]) % MOD;
                } else if (prev == '*') {
                    dp[i] = (dp[i] + dp[i - 2] * (cur <= '6' ? 2 : 1)) % MOD;
                }
            } else if (cur == '*') {
                dp[i] = dp[i - 1] * 9 % MOD;

                if (prev == '1') {
                    dp[i] = (dp[i] + dp[i - 2] * 9) % MOD;
                } else if (prev == '2') {
                    dp[i] = (dp[i] + dp[i - 2] * 6) % MOD;
                } else if (prev == '*') {
                    dp[i] = (dp[i] + dp[i - 2] * 15) % MOD;
                }
            }
        }

        return (int) dp[pressedKeys.length()];
    }
}

public int[] maxNumber(int[] nums1, int[] nums2, int k) {
    int m = nums1.length, n = nums2.length;
    int[] res = new int[k];

    for (int i = Math.max(0, k - n); i <= k && i <= m; i++) {
        int[] candidate = merge(maxArray(nums1, i), maxArray(nums2, k - i), k);
        if (greater(candidate, 0, res, 0)) {
            res = candidate;
        }
    }

    return res;
}

private int[] maxArray(int[] nums, int k) {
    int n = nums.length;
    int[] res = new int[k];
    int len = 0;
    for (int i = 0; i < n; i++) {
        while (len > 0 && len + n - i > k && res[len - 1] < nums[i]) {
            len--;
        }
        if (len < k) {
            res[len++] = nums[i];
        }
    }
    return res;
}

private int[] merge(int[] nums1, int[] nums2, int k) {
    int[] res = new int[k];
    for (int i = 0, j = 0, r = 0; r < k; r++) {
        res[r] = greater(nums1, i, nums2, j) ? nums1[i++] : nums2[j++];
    }
    return res;
}

private boolean greater(int[] nums1, int start1, int[] nums2, int start2) {
    while (start1 < nums1.length && start2 < nums2.length && nums1[start1] == nums2[start2]) {
        start1++;
        start2++;
    }
    return start2 == nums2.length || (start1 < nums1.length && nums1[start1] > nums2[start2]);
}

