        for (int j = 0; j < 3; j++) {
            if (obstacles[i] == j + 1) {
                dp[i][j] = Integer.MAX_VALUE;
            } else {
                dp[i][j] = dp[i - 1][j];
            }
        }

        if (obstacles[i] != 1) {
            dp[i][0] = Math.min(dp[i][0], Math.min(dp[i][1] + 1, dp[i][2] + 1));
        }
        if (obstacles[i] != 2) {
            dp[i][1] = Math.min(dp[i][1], Math.min(dp[i][0] + 1, dp[i][2] + 1));
        }
        if (obstacles[i] != 3) {
            dp[i][2] = Math.min(dp[i][2], Math.min(dp[i][0] + 1, dp[i][1] + 1));
        }
    }

    return Math.min(dp[n - 1][0], Math.min(dp[n - 1][1], dp[n - 1][2]));
}

public class Solution {
