public int maximumUniqueSubarray(int[] nums) {
    HashSet<Integer> set = new HashSet<>();
    int maxSum = 0, currentSum = 0, left = 0;

    for (int num : nums) {
        while (set.contains(num)) {
            set.remove(nums[left]);
            currentSum -= nums[left];
            left++;
        }

        set.add(num);
        currentSum += num;
        maxSum = Math.max(maxSum, currentSum);
    }

    return maxSum;
}

