            if (isSelfDividing(i)) {
                result.add(i);
            }
        }

        return result;
    }

    private boolean isSelfDividing(int num) {
        int originalNum = num;

        while (num > 0) {
            int digit = num % 10;
            if (digit == 0 || originalNum % digit != 0) {
                return false;
            }
            num /= 10;
        }

        return true;
