public class Solution {
    public int numSimilarGroups(String[] strs) {
        if (strs == null || strs.length == 0) {
            return 0;
        }

        int n = strs.length;
        int groupCount = 0;
        boolean[] visited = new boolean[n];

        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                dfs(strs, i, visited);
                groupCount++;
            }
        }

        return groupCount;
    }

    private void dfs(String[] strs, int index, boolean[] visited) {
        visited[index] = true;

        for (int i = 0; i < strs.length; i++) {
            if (!visited[i] && (isSimilar(strs[index], strs[i]) || strs[index].equals(strs[i]))) {
                dfs(strs, i, visited);
            }
        }
    }

    private boolean isSimilar(String s1, String s2) {
        int count = 0;

        for (int i = 0; i < s1.length(); i++) {
            if (s1.charAt(i) != s2.charAt(i)) {
                count++;
            }
        }

        return count == 2;
    }
}

public class Solution {
    private int count = 0;

    public int countArrangement(int n) {
        boolean[] visited = new boolean[n+1];
        calculateArrangement(n, 1, visited);
        return count;
    }

    private void calculateArrangement(int n, int pos, boolean[] visited) {
        if (pos > n) {
            count++;
            return;
        }
        for (int i = 1; i <= n; i++) {
            if (!visited[i] && (i % pos == 0 || pos % i == 0)) {
                visited[i] = true;
                calculateArrangement(n, pos + 1, visited);
                visited[i] = false;
            }
        }
    }
}

