import java.util.*;

class Solution {
    public double[] medianSlidingWindow(int[] nums, int k) {
        int n = nums.length;
        PriorityQueue<Integer> minHeap = new PriorityQueue<>();
        PriorityQueue<Integer> maxHeap = new PriorityQueue<>(Collections.reverseOrder());
        double[] result = new double[n - k + 1];

        for (int i = 0; i < n; i++) {
            if (i >= k) {
                if (minHeap.remove(nums[i - k])) {
                    balanceHeaps(minHeap, maxHeap);
                } else {
                    maxHeap.remove(nums[i - k]);
                    balanceHeaps(minHeap, maxHeap);
                }
            }

            minHeap.offer(nums[i]);
            maxHeap.offer(minHeap.poll());
            balanceHeaps(minHeap, maxHeap);

            if (i >= k - 1) {
                if (k % 2 == 0) {
                    result[i - k + 1] = (double) minHeap.peek() / 2.0 + (double) maxHeap.peek() / 2.0;
                } else {
                    result[i - k + 1] = (double) minHeap.peek();
                }
            }
        }

        return result;
    }

    private void balanceHeaps(PriorityQueue<Integer> minHeap, PriorityQueue<Integer> maxHeap) {
        while (minHeap.size() < maxHeap.size()) {
            minHeap.offer(maxHeap.poll());
        }

        while (minHeap.size() > maxHeap.size() + 1) {
            maxHeap.offer(minHeap.poll());
        }
    }
}
