public class Solution {
    public int kInversePairs(int n, int k) {
        int mod = 1000000007;
        int[][] dp = new int[n + 1][k + 1];
        dp[0][0] = 1;

        for (int i = 1; i <= n; i++) {
            int[] prefixSum = new int[k + 1];
            prefixSum[0] = dp[i - 1][0];
            for (int j = 1; j <= k; j++) {
                prefixSum[j] = (prefixSum[j - 1] + dp[i - 1][j]) % mod;
            }

            for (int j = 0; j <= k; j++) {
                int val = (prefixSum[j] - (j - i >= 0 ? prefixSum[j - i] : 0) + mod) % mod;
                dp[i][j] = (dp[i][j] + val) % mod;
            }
        }

        return (dp[n][k] - (k > 0 ? dp[n][k - 1] : 0) + mod) % mod;
    }
}

