public int[][] splitPainting(int[][] segments) {
        TreeMap<Integer, Long> map = new TreeMap<>();

        for (int[] segment : segments) {
            map.put(segment[0], map.getOrDefault(segment[0], 0L) + segment[2]);
            map.put(segment[1], map.getOrDefault(segment[1], 0L) - segment[2]);
        }

        long sum = 0;
        int start = 0;
        List<int[]> result = new ArrayList<>();

        for (Map.Entry<Integer, Long> entry : map.entrySet()) {
            if (sum > 0) {
                result.add(new int[]{start, entry.getKey(), (int)sum});
            }
            sum += entry.getValue();
            start = entry.getKey();
        }

        return result.toArray(new int[result.size()][]);
    }

public int minStickers(String[] stickers, String target) {
        int n = target.length();
        int m = 1 << n;
        int[] dp = new int[m];
        Arrays.fill(dp, Integer.MAX_VALUE);
        dp[0] = 0;

        for (int i = 0; i < m; i++) {
            if (dp[i] == Integer.MAX_VALUE) continue;
            for (String sticker : stickers) {
                int nextState = i;
                for (char letter : sticker.toCharArray()) {
                    for (int j = 0; j < n; j++) {
                        if (target.charAt(j) == letter && ((nextState >> j) & 1) == 0) {
                            nextState |= 1 << j;
                            break;
                        }
                    }
                }
                dp[nextState] = Math.min(dp[nextState], dp[i] + 1);
            }
        }

        return dp[m - 1] == Integer.MAX_VALUE ? -1 : dp[m - 1];
    }

