class Solution {
    public int findInMountainArray(int target, MountainArray mountainArr) {
        int peakIndex = findPeakIndex(mountainArr);
        int targetIndex = binarySearchLeft(target, mountainArr, 0, peakIndex);
        if (targetIndex == -1) {
            targetIndex = binarySearchRight(target, mountainArr, peakIndex + 1, mountainArr.length() - 1);
        }
        return targetIndex;
    }

    public int findPeakIndex(MountainArray mountainArr) {
        int left = 0;
        int right = mountainArr.length() - 1;

        while (left < right) {
            int mid = left + (right - left) / 2;
            if (mountainArr.get(mid) < mountainArr.get(mid + 1)) {
                left = mid + 1;
            } else {
                right = mid;
            }
        }

        return left;
    }

    public int binarySearchLeft(int target, MountainArray mountainArr, int left, int right) {
        while (left <= right) {
            int mid = left + (right - left) / 2;
            int midElement = mountainArr.get(mid);

            if (midElement == target) {
                return mid;
            } else if (midElement < target) {
                left = mid + 1;
            } else {
                right = mid - 1;
            }
        }

        return -1;
    }

    public int binarySearchRight(int target, MountainArray mountainArr, int left, int right) {
        while (left <= right) {
            int mid = left + (right - left) / 2;
            int midElement = mountainArr.get(mid);

            if (midElement == target) {
                return mid;
            } else if (midElement < target) {
                right = mid - 1;
            } else {
                left = mid + 1;
            }
        }

        return -1;
    }
}

class Solution {
    public int maxSatisfied(int[] customers, int[] grumpy, int X) {
        int n = customers.length;
        int satisfiedCustomers = 0;
        int maxSatisfiedCustomers = 0;

        for (int i = 0; i < n; i++) {
            if (grumpy[i] == 0) {
                satisfiedCustomers += customers[i];
            }
        }

        for (int i = 0; i < X; i++) {
            if (grumpy[i] == 1) {
                satisfiedCustomers += customers[i];
            }
        }

        maxSatisfiedCustomers = satisfiedCustomers;

        for (int i = X; i < n; i++) {
            if (grumpy[i] == 1) {
                satisfiedCustomers += customers[i];
            }
            if (grumpy[i - X] == 1) {
                satisfiedCustomers -= customers[i - X];
            }
            maxSatisfiedCustomers = Math.max(maxSatisfiedCustomers, satisfiedCustomers);
        }

        return maxSatisfiedCustomers;
    }
}

public String reversePrefix(String word, char ch) {
    int index = word.indexOf(ch);
    if (index == -1) {
        return word;
    }

    char[] chars = word.toCharArray();
    reverse(chars, 0, index);
    return new String(chars);
}

private void reverse(char[] chars, int start, int end) {
    while (start < end) {
        char temp = chars[start];
        chars[start] = chars[end];
        chars[end] = temp;
        start++;
        end--;
    }
}

public int[] nextGreaterElement(int[] nums1, int[] nums2) {
    Map<Integer, Integer> map = new HashMap<>();
    Deque<Integer> stack = new ArrayDeque<>();
    int[] result = new int[nums1.length];

    for (int i = 0; i < nums2.length; i++) {
        while (!stack.isEmpty() && nums2[i] > nums2[stack.peek()]) {
            map.put(nums2[stack.pop()], nums2[i]);
        }
        stack.push(i);
    }

    while (!stack.isEmpty()) {
        map.put(nums2[stack.pop()], -1);
    }

    for (int i = 0; i < nums1.length; i++) {
        result[i] = map.get(nums1[i]);
    }

    return result;
}

public class Solution {
    public int kthGrammar(int n, int k) {
        if (n == 1) {
            return 0;
        }

        int mid = (int) Math.pow(2, n - 1) / 2;

        if (k <= mid) {
            return kthGrammar(n - 1, k);
        } else {
            return 1 - kthGrammar(n - 1, k - mid);
        }
    }
}
